import React, { useState } from 'react';

const Joke = () => {
    const fetchJoke = () => {
        fetch("https://api.chucknorris.io/jokes/random")
        .then(res => res.json)
        .then(data => {
           return data.value;
        });
    }

    const [joke,setJoke] = useState()

    return (
        <div>
            <p>{joke}</p>
            <button onClick={setJoke(fetchJoke())}>Get Chuck Norris Joke</button>
        </div>
    )
}

export default Joke;
